import React from 'react';
import classes from './WeatherFinder.module.css';

class WeatherFinder extends React.Component {
    render() {
        return (
            <div className={classes.WeatherFinder}>
                <h1>Weather Finder</h1>
            </div>
        );
    }
}

export default WeatherFinder;
